import { get, post, patch, put, del } from './axios-c';
const API_KEY = "AIzaSyCvHcIZbtF80KUW23vCV_kmmr2EVixerAI";
// const mpc = "https://maps.googleapis.com/maps/api/place";
const mpc = "/mpc";


export const _reg = async (data) => await post('http://csci2720-g105.cse.cuhk.edu.hk/loc/users/reg', data)
export const _update = async (data) => await post('http://csci2720-g105.cse.cuhk.edu.hk/loc/users/update', data)
export const _login = async (data) => await post('http://csci2720-g105.cse.cuhk.edu.hk/loc/users/login', data)

export const _getUserList = async () => await get(`http://csci2720-g105.cse.cuhk.edu.hk/loc/users`)
export const _delUser = async (id) => await get(`/loc/users/del?id=${id}`)



export const _addPlace = async (data) => await post('http://csci2720-g105.cse.cuhk.edu.hk/loc/addPlace', data)
export const _saveJson = async (data) => await post('http://csci2720-g105.cse.cuhk.edu.hk/loc/saveJson', data, {
    headers: {
        "Content-Type": "application/x-www-form-urlencoded"
    }
})
export const _saveReviewsJson = async (data) => await post('http://csci2720-g105.cse.cuhk.edu.hk/loc/saveReviewsJson', data, {
    headers: {
        "Content-Type": "application/x-www-form-urlencoded"
    }
})
export const _updateText = async (data) => await post('http://csci2720-g105.cse.cuhk.edu.hk/loc/updateText', data, {
    headers: {
        "Content-Type": "application/x-www-form-urlencoded"
    }
})
export const _getJson = async () => await get('http://csci2720-g105.cse.cuhk.edu.hk/loc/getJson')


export const _getPidsList = async (url) => await get(`${mpc}${url}`)

export const _getPinfosList = async (url) => await get(`${mpc}${url}`)

export const _getPlaceInfo = async (id) => await get(`http://csci2720-g105.cse.cuhk.edu.hk/loc/getPlaceInfo?place_id=${id}`)


export const _getFavsList = async (id) => await get(`http://csci2720-g105.cse.cuhk.edu.hk/loc/getFavsList?user_id=${id}`)

export const _getPlacesLists = async () => await get(`http://csci2720-g105.cse.cuhk.edu.hk/loc/getPlacesLists`)
export const _delPlace = async (id) => await get(`http://csci2720-g105.cse.cuhk.edu.hk/loc/delPlace?id=${id}`)
export const _updatePlace = async (data) => await post(`http://csci2720-g105.cse.cuhk.edu.hk/loc/updatePlace`, data)





export const _getTenData = async () => await get(`http://csci2720-g105.cse.cuhk.edu.hk/loc/tenData`)
export const _getDaysData = async () => await get(`http://csci2720-g105.cse.cuhk.edu.hk/loc/daysData`)
